create table Service
(
    Id       int auto_increment
        primary key,
    Name     varchar(255)                not null,
    CarId    int                         not null,
    WorkerId int                         not null,
    TypeId   int                         not null,
    Amount   decimal(19, 2) default 0.00 not null,
    Time     timestamp                   null,
    constraint Service_ibfk_1
        foreign key (CarId) references Car (Id),
    constraint Service_ibfk_2
        foreign key (WorkerId) references Worker (Id),
    constraint Service_ibfk_3
        foreign key (TypeId) references TypeService (Id)
);

create index CarId
    on Service (CarId);

create index TypeId
    on Service (TypeId);

create index WorkerId
    on Service (WorkerId);

